import React from "react";


function IntraNav() {
    return (

    <nav className="intra-nav">
        <a href="#web-servers">Web Servers</a>
        <a href="#frontend-design">Frontend Design</a>
        <a href="#images-and-css">Images & CSS</a>
        <a href="#forms">Forms</a>
        <a href="#node">Node npm Express</a>
        <a href="#js">Javascript</a>
        <a href="#dom">DOM</a>
    </nav>

    );
}

export default IntraNav;
